// src/Pages/Restaurant.js
import React, { useEffect, useState } from 'react';

function Restaurant() {
  const [restaurants, setRestaurants] = useState([]);

  useEffect(() => {
    // Giả lập dữ liệu, sau sẽ dùng API
    setRestaurants([
      { id: 1, name: 'Nhà hàng A', address: '123 Đường ABC' },
      { id: 2, name: 'Nhà hàng B', address: '456 Đường XYZ' },
    ]);
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2>Danh sách Nhà hàng</h2>
      <table border="1" cellPadding="10" style={{ width: '100%', marginTop: '10px' }}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Tên</th>
            <th>Địa chỉ</th>
          </tr>
        </thead>
        <tbody>
          {restaurants.map((res) => (
            <tr key={res.id}>
              <td>{res.id}</td>
              <td>{res.name}</td>
              <td>{res.address}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Restaurant;
